import React from "react";
import web from "../src/images/Fashion.svg";
import Commom from "./Commom";

const Home = () => {
  return (
    <>
      <Commom
        name="Designs that embrace you"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
      />
    </>
  );
};

export default Home;
